comment:
진짜 무작정 작가님 커버칠게 아니라 베댓애들이 하는말 잘보면 다 팩트라니까?
커버치는애들아 한번 정주행해봐;
진짜 초반에 재미있게 봤는데
이제는 한편보면서 재미 느끼지도 못하고 그냥 끝나버려;

아니 컷만 많으면 뭐해 그 많은 컷들에서 나오는 내용분량이 적다는거쟈너 컷이 52?54?근데 뭐해 내용은 '버그니까 없애' 이거 뿐인데;; 물타기가 아니라 사람들, 독자들에 피드백, 생각을 말하는게 물티기임? 생각 좀 하자;; 너무 물타기라 뭐라 하는거 아니냐;; 

그렇다고 안보는건 아님ㅎ 난 이 웹툰좋아함ㅎ
그냥 너무 물타기라 뭐라 하길래 보는 내가 안쓰러워서 말해봤다;; 그니까 너무 뭐라 하지 말자;;


아 근데 대부분 3줄이상이면 안읽는다는데;;
